  true,\n\t\"url\": null,\n\t\"notes\": \"<b>Rectangular Supercritical Wing (Ricketts)</b>
  - design and measured locations are provided in an Excel file <a href=\"https://c3.ndc.nasa.gov/dashlink/static/media/dataset/RSW_airfoil_coordinates_ricketts.xls\">RSW_airfoil_coordinates_ricketts.xls</a>
  .  One sheet is with Non dimensional coordinates (RSW-nd) to be able to compare
  with other supercritical airfoils.  The other sheet (RectSupercriticalWing) has
  the data which should be used to generate the grids.rnrn<b>Benchmark Supercritical
  Wing</b> are available in PDF file of tables. The data was OCR'd.   Matlab code
  was written to read data line by line to be able to extract the data.  The \"*\"
  flag associated with points that have deviation greater the specified value were
  replaced with blank space.  Bad lines were omitted - lines that have non-numerical
  digits.  rnrnrnComparison of Rectangular Supercritical Wing (Ricketts), Benchmark
  Supercritical Wing, MBB_A3rnrn<img src=\"https://c3.ndc.nasa.gov/dashlink/static/media/dataset/SCWairfoils.png\">rnrn2D
  Airfoil tested at DLR - comparison of theoretical and actual.rn<img src=\"rnhttps://c3.ndc.nasa.gov/dashlink/static/media/dataset/mbb_a3.png\"
